import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Router } from 'react-router-dom';
import Header  from './Header/Header';



function App() {
  return (
    <div className="App">
     <BrowserRouter>
        <Header />
        <Routes>
          <Route path="/" element={<Homepage />} />
        </Routes>
      </BrowserRouter>      
    </div>
  );
}

export default App;
